"original": |2-
        The Printer responds with one set of Job Attributes for each
        returned Job.  The Printer ignores (does not respond with) any
        requested attribute or value that is not supported or that is
        restricted by the security policy in force, including whether the
        requesting user is the user that submitted the Job
        (Job-originating user) or not (see Section 9).  However, the
        Printer MUST respond with the 'unknown' value for any supported
        attribute (including all REQUIRED attributes) for which the
        Printer does not know the value, unless it would violate the
        security policy.  See the description of the "out-of-band" values
        in the beginning of Section 5.1.
"fixed": |-
  - The Printer responds with one set of Job Attributes for each returned Job.  The Printer ignores (does not respond with) any requested attribute or value that is not supported or that is restricted by the security policy in force, including whether the requesting user is the user that submitted the Job (Job-originating user) or not (see Section 9).  However, the Printer MUST respond with the 'unknown' value for any supported attribute (including all REQUIRED attributes) for which the Printer does not know the value, unless it would violate the security policy.  See the description of the "out-of-band" values in the beginning of Section 5.1.
"ko": |-
  - 프린터는 반환된 각 작업에 대해 하나의 작업 속성 세트로 응답합니다. 프린터는 요청 사용자가 작업을 제출한 사용자(작업 시작 사용자)인지 여부를 포함하여 지원되지 않거나 시행 중인 보안 정책에 의해 제한되는 요청된 속성 또는 값을 무시(응답하지 않음)합니다( 섹션 9 참조). 그러나 프린터는 보안 정책을 위반하지 않는 한 프린터가 값을 모르는 지원되는 속성(모든 필수 속성 포함)에 대해 '알 수 없음' 값으로 응답해야 합니다. 섹션 5.1 시작 부분의 "대역 외" 값에 대한 설명을 참조하세요.
